import React from "react";
import './Home.css';
import {Grid, Paper} from '@material-ui/core';

let nome = 'Rafael Souza'

function Home(){
    return(
        <>
        <Grid container>
            <Grid item xs={12} >
                <Paper style={{height: "100vh", background: "purple"}} />
            </Grid>

            <Grid item container>
                <Grid item>
                    <Paper style={{height: "49vh", background: "greenyellow"}}  />
                </Grid>

                <Grid item>
                    <Paper style={{height: "49vh", background: "yellow"}}  />
                </Grid>

            </Grid>
        </Grid>
        </>
    );

}

export default Home;
